fn matrix_mix (state: &mut Vec<Fr>) {

    let t = 3;

    let mut new_state = vec![Fr::zero(); t];

    let m_11 = Fr::from_str(MDS[0]).map_err(|_| ()).unwrap();
    let m_12 = Fr::from_str(MDS[1]).map_err(|_| ()).unwrap();
    let m_13 = Fr::from_str(MDS[2]).map_err(|_| ()).unwrap();

    let elem_0 = state[0].mul(&m_11);
    let elem_1 = state[1].mul(&m_12);
    let elem_2 = state[2].mul(&m_13);

    new_state[0] = elem_0;
    new_state[0] += &elem_1;
    new_state[0] += &elem_2;

    let m_21 = Fr::from_str(MDS[3]).map_err(|_| ()).unwrap();
    let m_22 = Fr::from_str(MDS[4]).map_err(|_| ()).unwrap();
    let m_23 = Fr::from_str(MDS[5]).map_err(|_| ()).unwrap();

    let elem_3 = state[0].mul(&m_21);
    let elem_4 = state[1].mul(&m_22);
    let elem_5 = state[2].mul(&m_23);

    new_state[1] = elem_3;
    new_state[1] += &elem_4;
    new_state[1] += &elem_5;

    let m_31 = Fr::from_str(MDS[6]).map_err(|_| ()).unwrap();
    let m_32 = Fr::from_str(MDS[7]).map_err(|_| ()).unwrap();
    let m_33 = Fr::from_str(MDS[8]).map_err(|_| ()).unwrap();

    let elem_6 = state[0].mul(&m_31);
    let elem_7 = state[1].mul(&m_32);
    let elem_8 = state[2].mul(&m_33);

    new_state[2] = elem_6;
    new_state[2] += &elem_7;
    new_state[2] += &elem_8;

    state[0] = new_state[0];
    state[1] = new_state[1];
    state[2] = new_state[2];

}

fn print_cst () {
    for i in 0..195 {
        let cst = Fr::from_str(ROUND_CST[i]).map_err(|_| ()).unwrap();
        println!("{:?}", cst);
    }
}

fn poseidon_perm (state: &mut Vec<Fr>) {

    //let r_f = 4;
    let r_f = 1;
    let r_p = 57;
    let mut round_cst_idx = 0;

    // Full rounds
    for _i in 0..r_f {
        for d in state.iter_mut() {
            let rc = Fr::from_str(ROUND_CST[round_cst_idx]).map_err(|_| ()).unwrap();
            //let rc = PoseidonParameters::ROUND_CST[round_cst_idx];
            *d += &rc;
            round_cst_idx += 1;
        }

        for d in state.iter_mut() {
            let elem_state = (*d).inverse();
            match elem_state {
                None => println!("Field inversion error"),
                Some(inv) => {
                    *d = inv;
                },
            }
        }
        matrix_mix (state);
    }

    // Partial rounds
    for _i in 0..r_p {
        for d in state.iter_mut() {
            let rc = Fr::from_str(ROUND_CST[round_cst_idx]).map_err(|_| ()).unwrap();
            *d += &rc;
            round_cst_idx += 1;
        }

        // apply s-box only to the first element of the state vector
        let t1 = (state[0]).inverse();
        match t1 {
            None => println!("Field inversion error"),
            Some(inv) => {
                state[0] = inv;
            },
        }
        matrix_mix (state);
    }

    // Full rounds
    for _i in 0..(r_f-1) {
        for d in state.iter_mut() {
            let rc = Fr::from_str(ROUND_CST[round_cst_idx]).map_err(|_| ()).unwrap();
            *d += &rc;
            round_cst_idx += 1;
        }

        for d in state.iter_mut() {
            let elem_state = (*d).inverse();
            match elem_state {
                None => println!("Field inversion error"),
                Some(inv) => {
                    *d = inv;
                },
            }
        }
        matrix_mix (state);
    }
    // Last full round does not perform the matrix_mix
    for d in state.iter_mut() {
        let rc = Fr::from_str(ROUND_CST[round_cst_idx]).map_err(|_| ()).unwrap();
        *d += &rc;
        round_cst_idx += 1;
    }

    for d in state.iter_mut() {
        let elem_state = (*d).inverse();
        match elem_state {
            None => println!("Field inversion error"),
            Some(inv) => {
                *d = inv;
            },
        }
    }

}

